window.bookSummaryJSON = "<p><b>In</b><b><i> File Zero</i></b><b>, Agent Zero’s memory finally comes flooding back - and with it, shocking revelations about the CIA’s secret plot to spark a war and to take his life. Disavowed and on the run, can he stop them in time? </b></p> <p>When an incident in the Strait of Hormuz threatens to mushroom into an all-out war, Agent Zero’s memory comes rushing back, and with it, a chance to uncover the plot that caused his memory loss to begin with. Discredited, with few friends left, Zero is on his own as he tries to stop the CIA while also saving his targeted family.&nbsp;</p> <p>Yet as he digs deeper, another, more nefarious, plot comes to surface, one which will require him to trust no one, and to risk it all to save the country he loves.&nbsp;</p> <p><i>File Zero (Agent Zero, Book 5)</i> is an enthralling espionage thriller that will keep you listening late into the night.</p>"; 
